$(function(){var n,t;$("#Address_StateId").val()===""&&(n="<option value=''>Wybierz województwo<\/option>",$("#Address_DistrictId").html(n).show);$("#Address_DistrictId").val()===""&&(t="<option value=''>Wybierz powiat<\/option>",$("#Address_CommuneId").html(t).show());$("#Address_StateId").change(function(){var t=$(this).val(),n=$("#Address_DistrictId"),i=$("#Address_CommuneId");t===""?n.html("<option value=''>Wybierz województwo<\/option>").show:$.ajax({cache:!1,type:"GET",url:"/Addresses/GetDistrictsAJAX",data:{id:t},success:function(t){n.html("");n.append($("<option><\/option>").val("").html("Wybierz"));$.each(t,function(t,i){n.append($("<option><\/option>").val(i.id).html(i.name))})},error:function(){alert("Błąd przy aktualizacji listy powiatów!")}});i.html("<option value=''>Wybierz powiat<\/option>").show()});$("#Address_DistrictId").change(function(){var t=$(this).val(),i=$("#Address_StateId").val(),n=$("#Address_CommuneId");t===""?n.html("<option value=''>Wybierz Powiat<\/option>").show:$.ajax({cache:!1,type:"GET",url:"/Addresses/GetCommunesAJAX",data:{stateId:i,districtId:t},success:function(t){n.html("");n.append($("<option><\/option>").val("").html("Wybierz"));$.each(t,function(t,i){n.append($("<option><\/option>").val(i.id).html(i.name))})},error:function(){alert("Błąd przy aktualizacji listy gmin!")}})});$("#Address_CommuneId").change(function(){var n=$(this).val(),t=$("#Address_CommuneType");$.ajax({cache:!1,type:"GET",url:"/Addresses/GetCommuneTypeAJAX",data:{communeId:n},success:function(n){t.val(n)},error:function(){alert("Błąd przy zapisywaniu rodzaju gminy!")}})})});